import React from 'react'
import './Shape.scss'

export default function Shape({count}) {
    return (
        <>
            <div className="shapes">
                {count.forEach(()=>{
                    return(
                        <span></span>
                    )
                })}
                <span></span>
                <span></span>
            </div>
        </>
    )
}
